window.bookSummaryJSON = "<p><b>It all started the moment I woke finding myself facing a new nightmare.</b></p> <p>A face I knew well...<i>my own. </i>So now there’s an imposter pretending to me at The Devil's Ring, and the question now is: how long will a HellBeast King be fooled?</p> <p>But then with two of us trying to get close, I can’t help but wonder which of us will be hunted, and which of us will be claimed.</p> <p>But most importantly, which way will fate swing for us in this game of beast and the bunny. Will I survive it or will it end up a HellBeast's mistake?</p>"; 
